import React from 'react'
import image from "../images/asdsd.jpg";
import Icons from './Icons';

const Project = (props) => {  
    const [images, setImages] = useState([]);

  useEffect(() => {
    fetch('/images.json')
      .then((response) => response.json())
      .then((data) => {
        setImages(data);
      })
      .catch((error) => {
        console.error('Error fetching images:', error);
      });
  }, []);
  return (
    <div key={props.key}> 
        <div data-inviewport="fade-up" class="project-grid  row mb-5">
            <div class="project">
                <div class="flex-container  p-4 border bg-light">
                    
                    <h4 className='mb-3' style={{"--theme-color": props.theme}}>{props.title}</h4>
                
                    
                    <p class="d-inline-block mb-3">
                    {props.description}
                    </p>
                    <div class="project__icons ">
                    {props.technologies.map(item => (
                        <Icons color={item.color} name={item.name} icon={item.icon}/>
                    ))}
                    </div>
                </div>
            </div>
            <div data-inviewport="fade-right" class="">
                <img key={props.key} class="rounded float-start portfolio-image" style={{width:"-webkit-fill-available"}} src={require(`../images/${'asdsd.jpg'}`).default} alt={props.image} />
            </div>
        </div>
    </div>
  )
}

export default Project
